import logo from './logo.svg';
import './App.css';
import React,{useState} from "react";

function App() {
  const [results, setResults] = useState([])

  React.useEffect(() => {
    fetch("http://localhost:3001/categories")
      .then(response => response.json())
      .then(data => {
        console.log(data);

      setResults(data)
    })
  },[])

  return (
    <>
    <header>My Stoer</header>
    <section>
      <nav>
        <div className="App">
        {results.map(d =>(
          <div key={d.id}>{d.title}</div>

        ))}
      </div>
      </nav>
    </section>

    </>
  );
}

export default App;
